(372,	'_transient_acf_plugin_info_pro',	'a:19:{s:4:\"name\";s:26:\"Advanced Custom Fields PRO\";s:4:\"slug\";s:26:\"advanced-custom-fields-pro\";s:7:\"version\";s:5:\"6.2.5\";s:8:\"homepage\";s:36:\"https://www.advancedcustomfields.com\";s:6:\"author\";s:155:\"<a href=\"https://wpengine.com/?utm_source=wordpress.org&utm_medium=referral&utm_campaign=plugin_directory&utm_content=advanced_custom_fields\">WP Engine</a>\";s:12:\"contributors\";a:1:{s:12:\"elliotcondon\";a:3:{s:7:\"profile\";s:36:\"https://www.advancedcustomfields.com\";s:6:\"avatar\";s:81:\"https://secure.gravatar.com/avatar/c296f449f92233e8d1102ff01c9bc71e?s=96&d=mm&r=g\";s:12:\"display_name\";s:22:\"Advanced Custom Fields\";}}s:8:\"requires\";s:3:\"5.8\";s:12:\"requires_php\";s:3:\"7.0\";s:6:\"tested\";s:5:\"6.4.2\";s:5:\"added\";s:10:\"2024-01-02\";s:12:\"last_updated\";s:10:\"2024-01-16\";s:11:\"description\";s:5216:\"<p>Advanced Custom Fields (ACF) turns WordPress sites into a fully-fledged content management system by giving you all the tools to do more with your data.</p>\n\n<p>Use the ACF plugin to take full control of your WordPress edit screens, custom field data, and more.</p>\n\n<p><strong>Add fields on demand.</strong></p>\n<p>The ACF field builder allows you to quickly and easily add fields to WP edit screens with only the click of a few buttons! Whether it’s something simple like adding an “author” field to a book review post, or something more complex like the structured data needs of an ecommerce site or marketplace, ACF makes adding fields to your content model easy.</p>\n\n<p><strong>Add them anywhere.</strong></p>\n<p>Fields can be added all over WordPress including posts, pages, users, taxonomy terms, media, comments and even custom options pages! It couldn’t be simpler to bring structure to the WordPress content creation experience.</p>\n\n<p><strong>Show them everywhere.</strong></p>\n<p>Load and display your custom field values in any theme template file with our hassle-free, developer friendly functions! Whether you need to display a single value or generate content based on a more complex query, the out-of-the-box functions of ACF make templating a dream for developers of all levels of experience.</p>\n\n<p><strong>Any Content, Fast.</strong></p>\n<p>Turning WordPress into a true content management system is not just about custom fields. Creating new custom post types and taxonomies is an essential part of building custom WordPress sites. Registering post types and taxonomies is now possible right in the ACF UI, speeding up the content modeling workflow without the need to touch code or use another plugin.</p>\n\n<p><strong>Simply beautiful and intentionally accessible.</strong></p>\n<p>For content creators and those tasked with data entry, the field user experience is as intuitive as they could desire while fitting neatly into the native WordPress experience. Accessibility standards are regularly reviewed and applied, ensuring ACF is able to empower as close to anyone as possible.</p>\n\n<p><strong>Documentation and developer guides.</strong></p>\n<p>Over 10 plus years of vibrant community contribution alongside an ongoing commitment to clear documentation means that you’ll be able to find the guidance you need to build what you want.</p>\n\n<h4>Features</h4>\n<ul>\n<li>Simple & Intuitive</li>\n<li>Powerful Functions</li>\n<li>Over 30 Field Types</li>\n<li>Extensive Documentation</li>\n<li>Millions of Users</li>\n</ul>\n\n<h4>Links</h4>\n<ul>\n<li><a href=\"https://www.advancedcustomfields.com/?utm_source=wordpress.org&utm_medium=free%20plugin%20listing&utm_campaign=ACF%20Website\">Website</a></li>\n<li><a href=\"https://www.advancedcustomfields.com/resources/?utm_source=wordpress.org&utm_medium=free%20plugin%20listing&utm_campaign=ACF%20Website\">Documentation</a></li>\n<li><a href=\"https://support.advancedcustomfields.com\">Support</a></li>\n<li><a href=\"https://www.advancedcustomfields.com/pro/?utm_source=wordpress.org&utm_medium=free%20plugin%20listing&utm_campaign=ACF%20Pro%20Upgrade\">ACF PRO</a></li>\n</ul>\n\n<h4>PRO</h4>\n<p>The Advanced Custom Fields plugin is also available in a professional version which includes more fields, more functionality, and more flexibility. The ACF PRO plugin features:</p>\n\n<ul>\n<li>The <a href=\"https://www.advancedcustomfields.com/resources/repeater/?utm_source=wordpress.org&utm_medium=free%20plugin%20listing&utm_campaign=ACF%20Pro%20Upgrade\">Repeater Field</a> allows you to create a set of sub fields which can be repeated again, and again, and again.</li>\n<li><a href=\"https://www.advancedcustomfields.com/resources/blocks/?utm_source=wordpress.org&utm_medium=free%20plugin%20listing&utm_campaign=ACF%20Pro%20Upgrade\">ACF Blocks</a>, a powerful PHP-based framework for developing custom block types for the WordPress Block Editor (aka Gutenberg).</li>\n<li>Define, create, and manage content with the <a href=\"https://www.advancedcustomfields.com/resources/flexible-content/?utm_source=wordpress.org&utm_medium=free%20plugin%20listing&utm_campaign=ACF%20Pro%20Upgrade\">Flexible Content Field</a>, which provides for multiple layout and sub field options.</li>\n<li>Use the <a href=\"https://www.advancedcustomfields.com/resources/options-page/?utm_source=wordpress.org&utm_medium=free%20plugin%20listing&utm_campaign=ACF%20Pro%20Upgrade\">Options Page</a> feature to add custom admin pages to edit ACF fields.</li>\n<li>Build fully customisable image galleries with the <a href=\"https://www.advancedcustomfields.com/resources/gallery/?utm_source=wordpress.org&utm_medium=free%20plugin%20listing&utm_campaign=ACF%20Pro%20Upgrade\">Gallery Field</a>.</li>\n<li>Unlock a more efficient workflow for managing field settings by reusing existing fields and field groups on demand with the <a href=\"https://www.advancedcustomfields.com/resources/clone/?utm_source=wordpress.org&utm_medium=free%20plugin%20listing&utm_campaign=ACF%20Pro%20Upgrade\">Clone Field</a>.</li>\n</ul>\n\n<p><a href=\"https://www.advancedcustomfields.com/pro/?utm_source=wordpress.org&utm_medium=free%20plugin%20listing&utm_campaign=ACF%20Pro%20Upgrade\">Upgrade to ACF PRO</a></p>\";s:12:\"installation\";s:649:\"<p>From your WordPress dashboard</p>\n\n<ol>\n<li><strong>Visit</strong> Plugins > Add New</li>\n<li><strong>Search</strong> for \"Advanced Custom Fields\" or “ACF”</li>\n<li><strong>Install and Activate</strong> Advanced Custom Fields from your Plugins page</li>\n<li><strong>Click</strong> on the new menu item \"ACF\" and create your first custom field group, or register a custom post type or taxonomy.</li>\n<li><strong>Read</strong> the documentation to <a href=\"https://www.advancedcustomfields.com/resources/getting-started-with-acf/?utm_source=wordpress.org&utm_medium=free%20plugin%20listing&utm_campaign=ACF%20Website\">get started</a></li>\n</ol>\";s:9:\"changelog\";s:4049:\"<h4>6.2.5</h4>\n<p><em>Release Date 16th January 2024</em></p>\n\n<ul>\n<li>Security Fix - The ACF shortcode will now run all output through <code>wp_kses</code>, escaping unsafe HTML. This may be a breaking change to your site but is required for security, a message will be shown in WordPress admin if you are affected. Please see the <a href=\"https://www.advancedcustomfields.com/blog/acf-6-2-5-security-release/\">blog post for this release for more information.</a> Thanks to Francesco Carlucci via Wordfence for the responsible disclosure</li>\n<li>Security - ACF now warns via an admin message, when upcoming changes to <code>the_field</code> and <code>the_sub_field</code> may require theme changes to your site to avoid stripping unsafe HTML. Please see the <a href=\"https://www.advancedcustomfields.com/blog/acf-6-2-5-security-release/\">blog post for this release for more information</a></li>\n<li>Security - Users may opt in to automatically escaping unsafe HTML via a new filter <code>acf/the_field/escape_html_optin</code> when using <code>the_field</code> and <code>the_sub_field</code> before this becomes default in an upcoming ACF release.</li>\n</ul>\n\n<h4>6.2.4</h4>\n<p><em>Release Date 28th November 2023</em></p>\n\n<ul>\n<li>Fix - Custom Post Types labels now match the WordPress 6.4 behavior for \"Add New\" labels</li>\n<li>Fix - When exporting both post types and taxonomies as PHP, taxonomies will now appear before post types, matching the order ACF registers them. This resolves issues where taxonomy slugs will not work in post type permalinks</li>\n<li>Fix - Advanced Settings for Taxonomies, Post Types or Options Pages now display with the correct top padding when toggled on</li>\n<li>Fix - When a parent option page is set to \"Redirect to Child Page\", the child page will now correctly show it\'s parent setting</li>\n<li>Fix - When activated as a must-use plugin, the ACF PRO \"Updates\" page is now visible. Use the existing <code>show_updates</code> setting to hide</li>\n<li>Fix - When activated as a must-use plugin, ACF PRO licenses defined in code will now correctly activate sites</li>\n<li>Fix - When <code>show_updates</code> is set or filtered to false, ACF PRO will now automatically still activate defined licenses</li>\n<li>i18n - Maintenance and internal upstream messages from the ACF PRO activation server are now translatable</li>\n</ul>\n\n<h4>6.2.3</h4>\n<p><em>Release Date 15th November 2023</em></p>\n\n<ul>\n<li><a href=\"https://www.advancedcustomfields.com/blog/acf-6-2-3/\">View Release Post</a></li>\n<li>New - An ACF Blocks specific JSON schema for block.json is now available on <a href=\"https://github.com/AdvancedCustomFields/schemas\">GitHub</a></li>\n<li>New - Flexible Content fields now show the layout name in the layout\'s header bar and supports click-to-copy</li>\n<li>New - Duplicating Flexible Content layouts now appends \"Copy\" to their name and label, matching the behavior of field group duplication</li>\n<li>Enhancement - ACF PRO will now automatically attempt license reactivation when the site URL changes, e.g. after a site migration. This resolves issues where updates may fail</li>\n<li>Enhancement - Presentation setting for \"High\" placement of the Field Group made clear that it\'s not supported in the block editor</li>\n<li>Fix - <code>acf_format_date</code> now ensures the date parameter is valid to prevent fatal errors if other data types are passed in</li>\n<li>Fix - CPTs with a custom icon URL now display the posts icon in the location column of the field groups screen</li>\n<li>Fix - The ACF JSON import form will now disable on first submit resolving an issue where you could submit the form twice</li>\n<li>Fix - The \"Add Row\" button in the Flexible Content field now displays correctly when using nested layouts</li>\n<li>Fix - Warning and Error notices no longer flicker on ACF admin pages load</li>\n<li>i18n - ACF PRO license activation success and error messages are now translatable</li>\n</ul>\n\n<p><a href=\"https://www.advancedcustomfields.com/changelog/\">View the full changelog</a></p>\";s:14:\"upgrade_notice\";s:253:\"<h4>6.2.5</h4>\nFrom ACF 6.2.5, the shortcode will now escape unsafe HTML automatically. This may be a breaking change. Please view <a href=\"https://www.advancedcustomfields.com/blog/acf-6-2-5-security-release/\">our release blog</a> for more information.\";s:5:\"icons\";a:1:{s:7:\"default\";s:63:\"https://ps.w.org/advanced-custom-fields/assets/icon-256x256.png\";}s:7:\"banners\";a:2:{s:3:\"low\";s:77:\"https://ps.w.org/advanced-custom-fields/assets/banner-772x250.jpg?rev=1729102\";s:4:\"high\";s:78:\"https://ps.w.org/advanced-custom-fields/assets/banner-1544x500.jpg?rev=1729099\";}s:8:\"versions\";a:183:{i:0;s:5:\"6.2.4\";i:1;s:5:\"6.2.3\";i:2;s:5:\"6.2.2\";i:3;s:7:\"6.2.1.1\";i:4;s:5:\"6.2.1\";i:5;s:5:\"6.2.0\";i:6;s:9:\"6.2.0-RC1\";i:7;s:11:\"6.2.0-beta1\";i:8;s:5:\"6.1.8\";i:9;s:5:\"6.1.7\";i:10;s:5:\"6.1.6\";i:11;s:5:\"6.1.5\";i:12;s:5:\"6.1.4\";i:13;s:5:\"6.1.3\";i:14;s:5:\"6.1.2\";i:15;s:5:\"6.1.1\";i:16;s:5:\"6.1.0\";i:17;s:11:\"